1,film/edit,film/edit/8,POST,"*""title"":""Chennai Express"",""description"":""Rahul (Shahrukh Khan) is a forty-year old bachelor and lives in Mumbai. Rahul's parents died in a car accident when he was eight years old and it was his grandparents who brought him up. His grandfather has a sweet-selling business - Y.Y. Mithaiwala - and he owns a chain of stores in Mumbai. Before his birth centenary celebration two of Rahul's friends suggest going to Goa for a vacation which he accepts. Right before the birth centenary, his grandfather dies. His grandmother tells him that his grandfather desired to have his ashes divided into two parts and have one part of it immersed at Rameswaram. She requests Rahul to go to Rameswaram and immerse the ashes. Rahul reluctantly accepts her request. On the other hand he was eager to attend the Goa trip, so, he and his friends make plans to dump the ashes at Goa. But, they were forced to change their plan when Rahul's grandmother told him that she would be coming to see him off at the station. This forces Rahul to travel by train and he booked a single ticket on the Chennai Express. He plans to meet his friends after commencing the journey at the Kalyan Junction station from where they would travel to Goa by car. Right after commencing the journey from Mumbai railway station, when the train was leaving the platform, Rahul sees a girl running to catch the train. He helps her to board the moving train."",""category_id"":""2""}",127.0.0.1,"Mozilla/5.0 (X11; Linux x86_64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/31.0.1650.63 Safari/537.36",,1,,"2014-02-19 14:58:27",admin
